import './App.css';


class App extends React.Component {
  render() {
    const shoppingList = ['leite', 'arroz', 'feijão', 'banana', 'carne'];
    const items = shoppingList.map((item , index) => {
      return (<li>{ items }</li>)
    })
     return (
     <div>
        <h2> Lista de compras </h2>
        <ul>
          {item}
        </ul>
     </div>
     );
  }
}

export default App;
